        public List<MoePost> DeserializeJson(String data)
        {
            DataContractJsonSerializerSettings settings = new DataContractJsonSerializerSettings();
            DataContractJsonSerializer serializer = new DataContractJsonSerializer(typeof(List<>).MakeGenericType(typeof(MoePost)));
            var code = Encoding.UTF8.GetBytes(data);
            MemoryStream stream = new MemoryStream(code);
            return (List<MoePost>)serializer.ReadObject(stream);
        }

