    /// <summary>
    /// 表示一张Booru所使用的图片,所有Booru所使用的图片都是由此类派生.
    /// </summary>
    public class BasePost : Controls.Primitives.IItemGenerator
    {
        public Uri PreviewImageUrl { get; set; }
        /// <summary>
        /// 返回预览图片宽
        /// </summary>
        public int PreviewImageWidth { get; set; }
        /// <summary>
        /// 返回预览图片高
        /// </summary>
        public int PreviewImageHeight { get; set; }
        /// <summary>
        /// 返回样图地址
        /// </summary>
        public Uri SampleImageUrl { get; set; }
        /// <summary>
        /// 返回原图地址
        /// </summary>
        public Uri ImageUrl { get; set; }
        /// <summary>
        /// 返回图片ID
        /// </summary>
        public int Id { get; set; }
        
        public object GenerateItem()
        {
            return new PostItem(this as BasePost);
        }
    }

    /// <summary>
    /// 表示一个 Moebooru 所使用的Post
    /// </summary>
    public class MoePost
    {
        public long id { get; set; }
        public string tags { get; set; }
        public long? creator_id { get; set; }
        public String author { get; set; }
        public long change { get; set; }
        public String source { get; set; }
        public long score { get; set; }
        public String md5 { get; set; }
        public long file_size { get; set; }
        public String file_url { get; set; }
        public bool is_shown_in_index { get; set; }
        public String preview_url { get; set; }
        public int preview_width { get; set; }
        public int preview_height { get; set; }
        public int actual_preview_width { get; set; }
        public int actual_preview_height { get; set; }
        public String sample_url { get; set; }
        public int sample_width { get; set; }
        public int sample_height { get; set; }
        public long sample_file_size { get; set; }
        public String jpeg_url { get; set; }
        public int jpeg_width { get; set; }
        public int jpeg_height { get; set; }
        public long jpeg_file_size { get; set; }
        public string rating { get; set; }
        public bool has_children { get; set; }
        public String parent_id { get; set; }
        public String status { get; set; }
        public int width { get; set; }
        public int height { get; set; }
        public bool is_held { get; set; }
